var delay = 1*3600;
function configMotherships(game){
  let c = [240,0];
  for (let ship of game.ships){
    let i = teams.motherships.indexOf(ship.id);
    (i != -1) && ship.set({type:791,shield:teams.motherships_health[i],hue:c[i],x:ship.team?120:-120});
  }
  echoc("Motherships have been set","#fecce5");
}

function checkMotherships(game) {
  return teams.motherships.map(i=> Number(!!game.findShip(i)))
}

this.tick = function(game){
  modUtils.tick();
  if (game.step === delay){
    modUtils.setTimeout(function(){sendUI(game, {id:"delay time",visible:false});},10);
    for (let ship of game.ships){
      ship.set({idle:false,collider:true,angle:ship.team*180});
      sendUI(ship, {id:"delay",visible:false});
      if (ship.custom.wait){
        ship.custom.wait = false;
      }
    }
    echoc("Round started","#ccccfe");
  }
  if (game.step % 30 === 0){
    if (game.ships.length < 2 && !game.custom.okay) delay = game.step+1*3600;
    teams.count = [0,0];
    for (let ship of game.ships){
      if (!ship.custom.init){
        ship.custom.init = true;
        ship.frags = 0;
        ship.deaths = 0;
        setteam(ship);
        setup(ship);
        sendUI(ship, {
          id: "buy_lifes_blocker",
          visible: true,
          clickable: true,
          shortcut: String.fromCharCode(187),
          position: [65,0,10,10],
          components: []
        });
        sendUI(ship, getRadarInfo());
        echoc(`${ship.name} spawned`,"#fefecc");
        if (!game.custom.delayed){
          game.custom.delayed = true;
          delay += game.step;
        }
        if (game.step > delay){
        } else {ship.custom.wait = true;}
      } teams.count[ship.custom.team]++;
      shipshield(ship);
    }
    if (game.step < delay){
      for (let ship of game.ships){
        ship.set({idle:true,vx:0,vy:0,collider:false});
        sendUI(ship, {
          id:"delay",position:[39,18,42,40],visible:true,
          components: [{type: "text",position:[2,5,80/1.5,33/1.5],value:"Waiting for more players...",color:def_clr}]
        });
        sendUI(ship, {
          id:"scoreboard",visible:true,
          components: [{type: "text",position:[15,0,70,10],value:"Waiting for more players...",color:def_clr}]
        });
      }
    } else {
      game.custom.okay = true;
      if (!game.custom.motherships){
        game.custom.motherships = true;
        for (let ship of game.ships) teams.ships[ship.custom.team].push(ship.id);
        teams.motherships = teams.ships.map(id=> id[0]);
        configMotherships(game);
      }
      for (let ship of game.ships){
        for (let i=0; i<2; i++){
          if (ship.id != teams.motherships[i]) {
            let mth = game.findShip(teams.motherships[i]);
            if (mth) drawdirectionmarker(ship,mth.x,mth.y,true,true,teams.names[i],getcolor(teams.hues[i]),"\u{1F30C}");
            else sendUI(game,  {id:teams.names[i],visible:false});
          }
        }
      }
      if (game.step > delay && !game.custom.ended) {
        let n = checkMotherships(game);
        if (!Math.min(...n)) {
          let succ = n.indexOf(0), suc = !1;
          if (teams.ships[succ].length !== 0) {
            for (let sus of teams.ships[succ]) {
              if (game.findShip(sus)) {
                teams.motherships[succ] = sus;
                suc = !0;
                break;
              }
            }
          }
          if (!suc) endgame(game, succ, "left the game");
          else if (teams.motherships_health.indexOf(0) == -1) {
            configMotherships(game);
            sendUI(game,  {
              id: "reset",
              visible: true,
              position: [20,5,100,100],
              components: [
              	{type: "text",position:[9,-6,40,40],value:`${teams.names[succ]}'s mothership left the game`,color:def_clr},
              	{type: "text",position:[9,0,40,40],value:`A new mothership has been assigned!`,color:def_clr}
              ]
            });
            modUtils.setTimeout(function(){
              sendUI(game,  {id:"reset",visible:false});
            },280);
          }
        }
        let zerohealth = teams.motherships_health.indexOf(0);
        zerohealth != -1 && endgame(game, zerohealth, "has been killed");
      }
    }
    let time = delay+1*3600;
    if (game.step < time){
      if (game.step < delay){
        if (game.custom.delayed && game.ships.length > 1){
          let steps = delay - game.step;
          let minutes = ~~(steps / 3600);
          let seconds = ~~((steps % 3600) / 60);
          if (seconds < 10) seconds = "0" + seconds;
          sendUI(game,  {
            id: "delay time",
            position: [45.7,26,10,7],
            visible: true,
            components: [
              {type: "text",position:[0,0,100,50],value:`${minutes}:${seconds}`,color:def_clr},
            ]
          });
        }
      }
    }
    checkteambase(game);
  }
  if (game.step % 15 === 0){
    for (let ship of game.ships){
      if (Math.abs(ship.x)>742) if (ship.type > 790 && ship.shield > 1400) ship.set({shield:ship.shield-1500});
      else ship.set({kill:true});
      if (ship.custom.spam){
        ship.emptyWeapons();
        game.addCollectible({code:11,x:ship.x,y:ship.y});
      }
    }
  }
  if (game.step % 800 === 0) secondary(game);
  if (game.step > delay && game.step % 60 === 0){
    updateScoreboard(game);
    mothershiphealthbar(game);
    for (let ship of game.ships){
      if (ship.type > 790)
      mothershipability.tick(ship);
    }
  }
};

function shipshield(ship, b){
  let shields = [2200,1575,1125,725,770,525,945,775,375,900,1405,625,725,505];
  let postfix = "?";
  let value = 0;
  let shipshield = shields[(ship.type-700)-1];
  if (ship.type > 790) shipshield = mothership_health;
  if (shipshield>998){
    if (ship.shield<1000000){
      postfix = "K";
      value = (ship.shield/1000).toFixed(2);
    } else if (ship.shield<1000000000){
      postfix = "M";
      value = (ship.shield/1000000).toFixed(2);
    }
    let filled = ship.shield/shipshield;
    sendUI(ship, {
      id: "shieldBar",
      position: [3.3,10.5,17.4,3],
      visible: true,
      components: [
        {type:"box",position:[0,0,100,100],fill:"hsla(170, 32%, 28%, 1)",stroke:"hsla(170, 32%, 28%, 1)",width:2},
        {type:"box",position:[0,0,100*filled,100],fill:"hsla(192, 97%, 74%, 1)",stroke:"hsla(192, 97%, 74%, 1)",width:2},
        {type: "text",position:[80,0,20,100],value:value+postfix,color:"hsla(0, 0%, 0%, 1)"}
      ]
    });
  } else {
    sendUI(ship, {id:"shieldBar",visible:false});
  }
}

