function setteam(ship){
  let t;
  if ([...new Set(teams.count)].length == 1) t=teams.points.indexOf(Math.min(...teams.points));
  else t = teams.count.indexOf(Math.min(...teams.count));
  ship.custom.team = t;
  ship.set({type:701+((ship.custom.team*7)+(~~(Math.random()*7)))});
  configship(ship, t);
  echoc(teams.count,"#fee5cc");
}

function configship(ship,t){
  ship.set({hue:teams.hues[t],team:t,invulnerable:100,stats:88888888});
}

function setup(ship){
  let x = teams.x[ship.custom.team];
  ship.set({x:x,y:0,stats:88888888,invulnerable:100,shield:9999,crystals:980});
}

function isRange(a,b,c){
  return Math.min(a,b) <= c && c <= Math.max(a,b);
}

function rekt(ship,num){
  if (ship.shield<num){
    let val=ship.crystals + ship.shield;
    if (val < num) ship.set({kill:true});
    else ship.set({crystals:val-num,shield:0});
  }
  else ship.set({shield:ship.shield-num});
}

function endgame(game, succ, message){
  game.custom.ended = true;
  game.setOpen(false);
  let winner = Math.abs(succ-1), endmessage = `${teams.names[succ]}'s mothership ${message}!`, winmessage = `${teams.names[winner]} team wins the game!`;
  sendUI(game,  {
    id: "win",
    visible: true,
    position: [20,5,100,100],
    components: [
    	{type: "text",position:[9,0,40,40],value:endmessage,color:def_clr},
    	{type: "text",position:[22,22,16,8],value:winmessage,color:def_clr}
    ]
  });
  echoc(endmessage,"#cce5fe");
  echoc(winmessage,"#cce5fe");
  modUtils.setTimeout(function(){
    for (let ship of game.ships)
    ship.gameover({"Winner":teams.names[winner]+" team","Score":ship.score,"Frags":ship.frags,"Deaths":ship.deaths});
  },300);
}

function checkteambase(game){
  for (let ship of game.ships){
    let t = ship.custom.team;
    if (dist2points(ship.x, ship.y, teams.x[t], 0) <= base_AoE_radius && ship.type < 780){
      ship.set({invulnerable:100,generator:0});
      if (game.step > delay)
      sendUI(ship, {
        id: "open",
        visible: true,
        clickable: true,
        shortcut: "0",
        position: [5,30,10,10],
        components: [
          {type:"box",position:[0,0,100,100],fill:"hsla(0, 0%, 10%, 1)",stroke:def_clr,width:5},
          {type: "text",position:[9,0,60*1.4,40*1.4],value:"Switch Ship",color:def_clr},
          {type: "text",position:[20,42,60,40],value:"[0]",color:def_clr},
        ]
      });
    } else {
      sendUI(ship, {id:"open",visible:false});
      selectship(ship,false,true);
    }
    if (dist2points(ship.x, ship.y, teams.x[t], 0) <= base_AoE_radius && ship.type > 780){
      if (game.step-delay > 3600/2){
        rekt(ship,mothership_health/180);
        sendUI(ship, {
          id: "warnin",
          position: [28,20,40*1.4,40],
          visible: true,
          components: [{type:"text",position:[0,0,80,33*1.4],value:"Camping in your base ruins the game for others - your ship will take damage whilst inside the base!",color:"hsla(0, 88%, 80%, 1)"}]
        });
      }
      sendUI(ship, {id:"open",visible:false});
      selectship(ship,false,true);
    } else sendUI(ship, {id:"warnin",visible:false});
    let q = 1-ship.custom.team;
    if (dist2points(ship.x, ship.y, teams.x[q], 0) <= base_AoE_radius){
      rekt(ship,(ship.type < 790)?(10*Math.trunc(ship.type/100)):2000);
      sendUI(ship, {
        id: "warning",
        position: [34,20,40,40],
        visible: true,
        components: [{type:"text",position:[0,0,80,33],value:"You are in the emeny's base - your ship will take damage!",color:"hsla(0, 88%, 80%, 1)"}]
      });
    } else sendUI(ship, {id:"warning",visible:false});
  }
}

