    let t1color = ["hsla(0, 0%, 70%, 1)","hsla(20, 60%, 35%, 1)","hsla(53, 100%, 55%, 1)","hsla(94, 100%, 35%, 1)","hsla(187, 100%, 45%, 1)","hsla(270, 100%, 70%, 1)","hsla(0, 0%, 100%, 1)"];
